# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.db.models.Model~Subclass
    - django_password_validators
    - Member[password_history].Member[admin].Member[PasswordHistory]
  - - Django.db.models.Model~Subclass
    - django_password_validators
    - Member[password_history].Member[admin].Member[UserPasswordHistoryConfig]
  - - Django.db.models.Model~Subclass
    - django_password_validators
    - Member[password_history].Member[models].Member[PasswordHistory]
  - - Django.db.models.Model~Subclass
    - django_password_validators
    - Member[password_history].Member[models].Member[UserPasswordHistoryConfig]
  - - Django.db.models.Model~Subclass
    - django_password_validators
    - Member[password_history].Member[password_validation].Member[PasswordHistory]
  - - Django.db.models.Model~Subclass
    - django_password_validators
    - Member[password_history].Member[password_validation].Member[UserPasswordHistoryConfig]
